import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';
import Employe from '../../components/employe/Employe';
import ListConge from '../../components/conge/ListConge';

// les routes
import PageRoute from '../../routers';


import './dashboard.css';
import Topbar from '../pages/topbar';
import Sidebar from '../pages/sidebar';
import Section from '../pages/sections';



const Dashboard = () => {
    return(
            <BrowserRouter>
            <Topbar />
            <Sidebar />
            {/* <Section routes={PageRoute} /> */}
            
                <Switch>
                <Route path="/" exact component={Employe} />
                <Route path="/listConge" component={ListConge} /></Switch>
            
            <div className="footer">Footer de notre site, créer par le dévéloppeur kratos bosse</div>
            </BrowserRouter>
    )
}

export default Dashboard;
